function productController($scope){}function productListController($scope){
	$scope.productListData=productListData;
	$scope.orderBy=$scope.$stateParams.orderBy?$scope.$stateParams.orderBy:'id';
	var p=0,
		listLen=8,
		pSize=Math.ceil(($scope.productListData.list).length/listLen)-1,
		pStart = (p)*listLen,
		pEnd = (pSize)*listLen;
	$scope.paging={p:p,pSize:pSize,listLen:listLen,pStart:pStart,pEnd:pEnd,jump:function(i){
		if(i<0)return;
		if(i>$scope.paging.pSize)return;
		$scope.paging.p=i;
	}};

	//console.log(JSON.stringify($scope.paging));

	$scope.search="";
	$scope.change=function(){
		console.log($scope.search);
	};
	$scope.p=function(){
		console.log(JSON.stringify($scope.paging));
	};
}



